import React from "react";
import "../../assets/css/sidemenu.css";

const UserPage = () => {
  return (
    <div className="mainmenu d-flex pt-4 flex-wrap ps-4">
      <div className="d-flex">
        <div>
          <img
            src={require("../../assets/image/avatarL.png")}
            alt="Id number"
            height={"150"}
          />
        </div>
        <div className="d-flex mt-3 justify-content-center" style={{flex:"100%"}}>
          <div className="d-flex flex-column ms-3">
            <h4>Vansham</h4>
            <p className="m-0">member for 22 days</p>
          </div>
          <div className="d-flex">
            <div className="d-flex flex-column">
              <h4 className="text-center">11</h4>
              <p className="m-0">Answers</p>
            </div>
            <div className="d-flex flex-column ps-3">
              <h4 className="text-center">11</h4>
              <p className="m-0">Questions</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserPage;
